" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Assessment of fetal lung maturity",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?41/58/42919/contributors\">",
"     Authors",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?41/58/42919/contributors\">",
"     Jonathan Gillen-Goldstein, MD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?41/58/42919/contributors\">",
"     Andrew P MacKenzie, MD",
