var title_f41_58_42922="LVH tutorial";
var content_f41_58_42922=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F69040&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F69040&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1268px;\">",
"  <div class=\"figure\" style=\"width: 554px\">",
"   <div class=\"ttl\">",
"    Left ventricular hypertrophy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 534px; height: 230px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The electrocardiogram demonstrates a number of features of left ventricular hypertrophy (LVH). The QRS complex is slightly widened (about 0.11 sec), the frontal plane axis is leftward, tall R waves are present in multiple leads, and ST-T changes (formerly called a &ldquo;strain&rdquo; pattern) are present. The somewhat prominent P waves also raise consideration of left atrial abnormality. Slow R wave progression (V1-V3) is non-specific and may be seen with LVH, or with multiple other factors. Underlying anteroseptal MI is not excluded.",
"    <br>",
"     <br>",
"      <br>",
"       <br>",
"        <br>",
"         <div class=\"footnotes\">",
"         </div>",
"         <div class=\"reference\">",
"         </div>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 594px\">",
"   <div class=\"ttl\">",
"    Normal ECG",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 594px; height: 337px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal electrocardiogram showing normal sinus rhythm at a rate of 75 beats/min, a PR interval of 0.14 sec, a QRS interval of 0.10 sec, and a QRS axis of approximately 75&deg;.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Ary Goldberger, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
