var title_f41_58_42923="Types of airway stents";
var content_f41_58_42923=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F58596&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F58596&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Advantages and disadvantages of different airway stents",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Advantages",
"       </td>",
"       <td class=\"subtitle1\">",
"        Disadvantages",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        Silicone stents",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        <p>",
"         Easily inserted",
"        </p>",
"        <p>",
"         Repositioning and removal are easily accomplished",
"        </p>",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        <p>",
"         Rigid bronchoscopy and general anesthesia required",
"        </p>",
"        <p>",
"         Stent migration is common",
"        </p>",
"        <p>",
"         Granulation tissue may obstruct proximal or distal ends of stent",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        Metal stents",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        <p>",
"         May be introduced with fiberoptic scope without general anesthesia",
"        </p>",
"        <p>",
"         Self-expanding; resist extrinsic compression",
"        </p>",
"        <p>",
"         Minimal migration after placement",
"        </p>",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        <p>",
"         Cannot be easily removed or repositioned",
"        </p>",
"        <p>",
"         Granulation tissue or tumor easily grows through spaces between metal struts",
"        </p>",
"        <p>",
"         Expansile force may rupture airways and vascular structures",
"        </p>",
"        <p>",
"         More expensive than silicone stents",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        Hybrid stents",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        <p>",
"         Resist extrinsic compression",
"        </p>",
"        <p>",
"         Silicone membrane resists ingrowth of tumor or granulation tissue",
"        </p>",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        <p>",
"         Cannot be easily removed or repositioned",
"        </p>",
"        <p>",
"         Most expensive",
"        </p>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
