var title_f41_58_42925="Hyperkalemia rapid overview";
var content_f41_58_42925=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F74169&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F74169&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Hyperkalemia management rapid overview",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Clinical features",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Signs and symptoms are uncommon and tend to occur only when the serum potassium exceeds 7.0 meq/L; symptoms can include muscle weakness and ventricular arrhythmias",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       There are two major mechanisms of hyperkalemia:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Increased potassium release from cells (eg, severe hyperglycemia, rhabdomyolysis, succinylcholine)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Reduced potassium excretion in urine, most often due to hypoaldosteronism or renal failure",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Pseudohyperkalemia, which is most often due to hemolysis of the blood specimen, is the most common cause of a reported elevation in serum potassium and must be excluded. It does not reflect true hyperkalemia and does not produce ECG changes",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Electrocardiogram manifestations",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        Large interpatient variability",
"       </strong>",
"       exists in the relationship between the serum potassium and ECG changes; at a given serum potassium, ECG changes are more common with acute elevations and less common with chronic elevations (eg, chronic kidney disease)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Careful cardiac monitoring and serial ECGs are essential",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       ECG findings commonly progress as follows:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Peaked T waves",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Prolonged PR and QRS intervals, and small P waves",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Loss of P wave, further prolongation of QRS interval (\"sine wave\" pattern), and conduction delay that can manifest as bundle branch or AV nodal block",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Ventricular fibrillation or asystole can result",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Management",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        Confirm the patient is truly hyperkalemic",
"       </strong>",
"       (ie, exclude pseudohyperkalemia)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        Obtain electrocardiogram",
"       </strong>",
"       and, if signs of hyperkalemia are seen, place patient on cardiac monitor",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       The specific therapies that follow are listed according to their rapidity of action; the choice among them varies according to the severity of ECG changes and muscle weakness",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       <strong>",
"        Stabilize cardiac membranes with calcium:",
"       </strong>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Give",
"       <strong>",
"        only",
"       </strong>",
"       for hyperkalemia with significant ECG findings (eg, widening of the QRS complex or loss of P waves, but",
"       <strong>",
"        not",
"       </strong>",
"       peaked T waves alone) or severe arrhythmias thought to be caused by hyperkalemia",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Give adults",
"       <strong>",
"        calcium chloride",
"       </strong>",
"       500 to 1000 mg (5 to 10 mL of 10 percent solution) by IV infusion slowly over 2 to 3 minutes, preferably via a central line; or give",
"       <strong>",
"        calcium gluconate",
"       </strong>",
"       1000 mg (10 mL of 10 percent solution) also infused slowly; may be given peripherally in large vein; time to onset is immediate",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Calcium treatment may be repeated after 5 minutes if ECG changes persist; patient must be on cardiac monitor when receiving calcium; calcium can exacerbate digoxin toxicity",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Give children",
"       <strong>",
"        calcium gluconate",
"       </strong>",
"       (10 percent solution) 0.5 mL/kg",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Since the effect of calcium is transient, patients with hyperkalemia also require treatments to shift potassium into cells and to remove potassium",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       <strong>",
"        Shift potassium into cells:",
"       </strong>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Give insulin and glucose to hyperkalemic patients with ECG changes OR serum potassium &ge;6.5 to 7 meq/L",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       <strong>",
"        Insulin and glucose:",
"       </strong>",
"       Give IV bolus of regular insulin 10 units with 50 mL of a 50 percent glucose solution; give children regular insulin 0.2 units per gram of glucose, give glucose 1 g/kg; time to onset is 10 to 20 minutes; after insulin and glucose bolus therapy, start dextrose infusion; monitor fingerstick glucose closely",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       <strong>",
"        Beta 2 agonist:",
"       </strong>",
"       May give albuterol 10 to 20 mg in 4 mL saline nebulized over 10 minutes (may use metered dose inhaler); pediatric dose 0.1 to 0.3 mg/kg; time to onset is 20 to 30 minutes; IV albuterol or epinephrine are alternatives",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       <strong>",
"        Sodium bicarbonate:",
"       </strong>",
"       Provides minimal effect on shifting potassium intracellularly, even in acidemic patients; may give 150 meq in one liter of 5 percent dextrose in water at 250 mL/hour; do not give in same IV as calcium",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Since the effect of shifting potassium into the cells is transient, treatments to remove potassium are also required",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       <strong>",
"        Remove potassium",
"       </strong>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       <strong>",
"        Cation exchange resin (sodium polystyrene sulfonate):",
"       </strong>",
"       Give 15 to 30 grams of sodium polystyrene sulfonate (without sorbitol) orally; pediatric dose is 1 g/kg; although less preferable, sodium polystyrene sulfonate may be given as a retention enema (dose is 50 g) without sorbitol; time to onset is approximately 1 to 2 hours; may repeat dose after 4 to 6 hours based upon repeat serum potassium; Sorbitol can cause intestinal necrosis and should be avoided; Do not give sodium polystyrene sulfonate or sorbitol to post-operative or renal transplant patients",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       <strong>",
"        Loop or thiazide diuretic:",
"       </strong>",
"       Provides only limited short-term effect; May give furosemide 20 to 40 mg IV; pediatric dose is 1 to 2 mg/kg IV; higher dose may be required with renal insufficiency; fluid losses must be replaced unless the patient is volume expanded",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       <strong>",
"        Hemodialysis:",
"       </strong>",
"       Can be used if the conservative measures listed above fail, if hyperkalemia is severe, if the patient has renal failure, or if the patient has marked tissue breakdown and is releasing large amounts of potassium from injured cells",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
